import HeroBanner from "./components/Banner/HeroBanner";
import Button from "./components/Button/Button";

const bannerTitle = "Main Title";
const bannerSubTitle = "Sub Title";
const BannerButton = ""

function App() {
  return (
    <div className="App">
      <HeroBanner className="mainBanner">
        {bannerTitle != '' ? <h1>{bannerTitle}</h1> : ''}
        {bannerSubTitle != '' ? <p>{bannerSubTitle}</p> : ''}
        {BannerButton != '' ? <Button type="button" className="btn-primary">Explore Now</Button> : ''}
      </HeroBanner>
    </div>
  );
}

export default App;
